        return (
            <div >
                <Bar />
                <div  class="container-fluid">
                    <div class="row">
                        <div class="col-lg-12">
                           
                        </div>
                    </div>

                    <div class="row">
                        <div class="col-lg-4">

                        </div>

                        <div class="col-lg-4">
                          
                            </div>
                       

                        <div class="col-lg-4">

                        </div>



                    </div>

                </div>
            </div>
        );
    }

}
export default Contact;
